import React from "react";

const Form = () => {
  return (
   <div class="form-container">
        <div class="contact-box">
          <div class="left"></div>
          <div class="right">
            <h2>Contact Us</h2>
            <input type="text" class="field" placeholder="Full Name" />
            <input type="email" class="field" placeholder="Email" />
            <input type="text" class="field" placeholder="Phone Number" />
            <textarea class="field area" placeholder="Message"></textarea>
            <button class="btn">Send</button>
          </div>
        </div>
      </div>
  );
};

export default Form;
